import React from 'react'
import Navbar from '../Homepage/Navbar/Navbar'
import './cart.scss'
import CartShowcase from './CartShowcase/CartShowcase'

const Cart = () => {
  return (
    <>
        <Navbar/>
        <CartShowcase/>
    </>
  )
}

export default Cart
